        static string MostFrequentTriplet(string str, CancellationToken ct)
        {
            string[] s = str.Split(',');
            object _LogLock = new object();
            string stringOut = "";
            try
            {
                Parallel.For(0, s.Length, new ParallelOptions { CancellationToken = ct }, i =>
                  {


                      for (int j = 0; j < s[i].Length - 2; j++)
                      {
                          lock (_LogLock)
                          {
                              triplets.Add(s[i].Substring(j, 3));
                        }
                      }
                      
                  });
                var most = from i in triplets.AsParallel().WithCancellation(ct)

                           group triplets by i into grp1

                           where grp1.Count() == (from j in triplets
                                                  group triplets by j into grp
                                                  select grp.Count()
                                               ).Max()
                           select grp1.Key;

                int tripletCount = (from i in triplets.AsParallel().WithCancellation(ct)
                                    group triplets by i into grp
                                    orderby grp.Count() descending
                                    select grp.Count()).First();
                string[] sr = most.ToArray();
                stringOut =  string.Format("{0}\t{1}", string.Join(",", sr), tripletCount);

            }
            catch(OperationCanceledException ex)
            {
                Console.WriteLine("Операция прервана");
            }
            return stringOut;
        }
